"use strict";

function f_gold(nums) {
    let end = 0, mx = 0, steps = 0;
    for (let i = 0; i < nums.length - 1; i++) {
        let num = nums[i];
        mx = Math.max(mx, i + num);
        if (i === end) {
            end = mx;
            steps += 1;
        }
    }
    return steps;
}
